import React from 'react';
import StyledTitle from './Titles';
import styled from 'styled-components';
import { Col, Row } from 'antd';

const Paragraph = styled.div`
  p.subTitle {
    font-size: 1rem;
    font-weight: bold;
    span + span {
      margin-left: 10px;
    }
  }
  .intro {
    font-size: 1rem;
    color: #9e73a5;
    margin-bottom: 0.5rem;
  }
  .txt {
    word-break: keep-all;
    color: #666666;
  }

  & + & {
    margin-top: 2rem;
  }
`;

const AboutMe = () => {
  return (
    <div style={{ padding: '0 2rem' }}>
      <StyledTitle>
        <span>웹 프론트엔드 개발자 김해림은 어떤 사람? 🤔</span>
      </StyledTitle>
      <Row>
        <Col xs={24} md={16} xl={12}>
          <Paragraph>
            <p className='subTitle'>
              <span>✅</span>
              <span>웹 퍼블리셔 경력 2년 6개월! 반올림 해서 3년!</span>
            </p>
            <p className='intro'>
              웹 프론트엔드 개발자 김해림은 퍼블리싱을 2년 6개월 동안 한 경력이
              있습니다!
            </p>
            <p className='txt'>
              자사의 서비스 웹 페이지부터 Admin 페이지 및 SI 서비스를 퍼블리싱한
              경력이 있습니다. HTML, CSS3, JavaScript, Jquery, Ajax 언어를
              사용해왔습니다. 언제나 프로젝트는 책임감을 가지고 기간 내에
              서비스를 완성해 냈습니다!
            </p>
          </Paragraph>
          <Paragraph>
            <p className='subTitle'>
              <span>✅</span>
              <span>배움의 의지!</span>
            </p>
            <p className='intro'>
              개발의 즐거움은 '알아가는 것' 이라고 생각합니다!
            </p>
            <p className='txt'>
              눈깜박하면 바뀌는 개발 시장에서 가장 중요한 것은 ‘배우려는 의지'
              라고 생각합니다. 제가 작성한 코드들이 웹 어플리케이션이 되는
              기쁨을 느낀 뒤로 배우려는 자세를 늦추지 않고 있습니다. 개인 노션과
              티스토리 블로그, 깃 블로그를 이용해 배운 것을 기록하는 습관을
              가지고 있습니다.
            </p>
          </Paragraph>
        </Col>
        <Col xs={24} md={8} xl={12}></Col>
      </Row>
    </div>
  );
};

export default AboutMe;
